Texas schoonheid Susan Wright bleek in een sprookje te leven met een aanbiddende echtgenoot, Jeff, twee prachtige kinderen, en naaste familie en vrienden. Maar in 2003, zes jaar na hun huwelijk, toen Jeff dood wordt gevonden en begraven in de achtertuin van hun huis in de voorsteden. De hechte gemeenschap is geschokt als de politie Susan beschuldigt van moord met voorbedachte rade.


